org.teamapps.dictionary.pwd.dictionary.suggestions.passwords.notAllowed=Išbandykite kitą slaptažodį, kurio nėra pašalintų slaptažodžių sąraše, pridėkite papildomų žodžių arba skaitmenų.
# Straight rows of keys are easy to guess.
org.teamapps.dictionary.pwd.spatial.warning.straightRowsOfKeys=Lengva atspėti tiesias klavišų eiles.
# Short keyboard patterns are easy to guess.
org.teamapps.dictionary.pwd.spatial.warning.shortKeyboardPatterns=Trumpus klaviatūros modelius lengva atspėti.
# Use a longer keyboard pattern with more turns.
org.teamapps.dictionary.pwd.spatial.suggestions.UseLongerKeyboardPattern=Naudokite ilgesnį klaviatūros modelį su daugiau posūkių.
# Repeats like "aaa" are easy to guess.
org.teamapps.dictionary.pwd.repeat.warning.likeAAA=Tokius pasikartojimus kaip "aaa" lengva atspėti.
# Repeats like "abcabcabc" are only slightly harder to guess than "abc".
org.teamapps.dictionary.pwd.repeat.warning.likeABCABCABC=Tokius pasikartojimus kaip "abcabcabc" atspėti tik šiek tiek sunkiau nei "abc".
# Avoid repeated words and characters.
org.teamapps.dictionary.pwd.repeat.suggestions.avoidRepeated=Venkite pasikartojančių žodžių ir simbolių.
# Sequences like abc or 6543 are easy to guess.
org.teamapps.dictionary.pwd.sequence.warning.sequenceWarning=Tokias sekas kaip abc arba 6543 lengva atspėti.
# Avoid sequences.
org.teamapps.dictionary.pwd.sequence.suggestions.avoidSequences=Venkite sekų.
# Recent years are easy to guess.
org.teamapps.dictionary.pwd.year.warning.recentYears=Pastarųjų metų duomenis nesunku atspėti.
# Avoid recent years, avoid years that are associated with you.
org.teamapps.dictionary.pwd.year.suggestions.avoidYears=Venkite pastarųjų metų, venkite su jumis susijusių metų.
# Dates are often easy to guess.
org.teamapps.dictionary.pwd.date.warning.dates=Datas dažnai lengva atspėti.
# Avoid dates and years that are associated with you.
org.teamapps.dictionary.pwd.date.suggestions.avoidDates=Venkite su jumis susijusių datų ir metų.
